import React from 'react'
import GitHubIcon from '@mui/icons-material/GitHub';


function Footer() {
  return (
    <div className="Footer">

        <div className="FooterText">

        <GitHubIcon sx={{ fontSize: 50 }}  />

        </div>

    </div>
  );
}

export default Footer;
